import { COLOR_BACKGROUND } from '../../constrant'
import './styles.css'

export default function CardTeam(){

    return(
        <div className="containerss" style={{background:COLOR_BACKGROUND}}>
            <img className='imgss' src="data:image/png;base64,"/>
            <a className='teamName' style={{color:'black'}}>Phonix Team</a>
        </div>
    )
}
